    def set_norton_R1_value(self):
            self.partB_1_R1_value.show(), self.partB_1_v1_value.hide()

    def set_norton_I1_value(self):
            self.partB_1_R1_value.hide(), self.partB_1_v1_value.show()

    def assign_value(self):
            self.rr = self.partB_1_R1_value.text()
            self.ii = self.partB_1_v1_value.text()

    def display_value(self):
            R = float(self.rr)
            I = float(self.ii)
            V = float(I*R)
            self.Multimeter_value_displayer.setText(" R1 = {0}Ω \n V1 = {1}V \n I1 = {2}A".format(self.rr, V, self.ii))


